:text: |
  Descendants of WILLIAMS, William and NELSON, Jane
  JWILLIAMS, James Nelson and BEETHAM, Mary-Margaret
  JWILLIAMS, Gertrude Mary Beetham and RUSSELL, Andrew Hamilton
  JRUSSELL, Margaret Gertrude (Margot) and LOWRY, Thomas Coleman (Tom)
  RUSSELL, Margaret Gertrude (Margot) and LOWRY, Thomas Coleman (Tom) (cont...)
  Tom was an outstanding cricketer. At Cambridge University he was in the XI, 1921-24 (captain 1924). He
  captained the Wellington XI from 1927 to 1933 in many provincial and international matches and led the New
  Zealand side in Australia (1925-36) and England (1927 and 1931), and the home team on a number of
  occasions. Tom was manager of the New Zealand team in England in 1937. He was chairman of the New Zealand
  Cricket Council and a life member of the MCC.
  Tom farmed at Taihape and later at Okawa where he was keenly involved with thoroughbred horses, serving for
  a period as President of the Thoroughbred Breeders' Association.
