  b 16.09.1963
  b 01.05.1959
  David b. at Gore, Southland and m, at Holy Trinity Church, Knightsbridge, London. Kate, d/o Colin
  Brown and Susan Hood, b. at Marsden Green nr Birmingham. Address: Glenaray Road, Waikaia,
  Southland.
  David was educated at Waihi School and Christ's College then graduated BAgCom from Lincoln
  University and gained his Advanced Diploma in Farm Management from the Royal Agricultural College
  in 1987. He has been Managing Director of W Pinckney Ltd since 1991.
  Kate grew up in Berkshire and Dorset and worked in London for nine years before marrying and moving
  to New Zealand.
