  b 05.07.1965
  Thomas b. at Gore. Address: Northburn, RD 3, Cromwell.
  Thomas was educated at Waihi and Christ's College. He graduated BComAg from Lincoln College and
  gained a Post Graduate Diploma in Advanced Agricultural Business Management at the Royal
  Agricultural College in 1990. He is now farming merinos at Northburn near Cromwell. He is
  interested in flying.
  03> PINCKNEY, Anna Mary
  b 25.05.1970
  Anna b. at Gore. Address: 14a Taylors Avenue, Bryndwr, Christchurch.
